import React from "react";


function  Users({prop, handleDelete}){
    const user = prop.users



    return (<div>
        {user.map((user)=> {
            return <div key={user.id}>
                <h2>{user.name}</h2>
                <p>{user.age}</p>
                <button onClick={()=>handleDelete(user.id)}>Delete</button>
            </div>
        })}
    </div>)
}

export default Users
